		[Test]
		[Ignore]
		public void TestSaveToDB()
		{
			var b = new ConsumerExperianModelBuilder();
			var outputRootSerializer = new XmlSerializer(typeof(OutputRoot));
			var outputRoot = (OutputRoot)outputRootSerializer.Deserialize(new StringReader(consumerData));
			var data = b.Build(outputRoot);

			data.ServiceLogId = 1;
			var con = m_oDB.GetPersistent();
			con.BeginTransaction();
			var id = m_oDB.ExecuteScalar<long>(con, "SaveExperianConsumerData", CommandSpecies.StoredProcedure, m_oDB.CreateTableParameter<ExperianConsumerData>("Tbl", new List<ExperianConsumerData> { data }));
			foreach (var cais in data.Cais)
			{
				cais.ExperianConsumerDataId = id;
			}
			m_oDB.ExecuteNonQuery(con, "SaveExperianConsumerDataCais", CommandSpecies.StoredProcedure,
			                      m_oDB.CreateTableParameter<ExperianConsumerDataCais>("Tbl", data.Cais));
			con.Commit();
		}

		[Test]
		[Ignore]
		public void TestReadFromDB()
		{

			var data = m_oDB.ExecuteEnumerable("LoadFullExperianConsumer", CommandSpecies.StoredProcedure, new QueryParameter("@ServiceLogId", 1));
			var d = new ExperianConsumerData();
			foreach (var sr in data)
			{
				switch ((string)sr["DatumType"])
				{
					case "ExperianConsumerData":
						sr.Fill(d);
						d.Id = sr["Id"];
						break;
					case "ExperianConsumerDataCais":
						var c = sr.Fill<ExperianConsumerDataCais>();
						c.Id = sr["Id"];
						d.Cais.Add(c); 
						break;
				}
			}
			Console.WriteLine(JsonConvert.SerializeObject(d, new JsonSerializerSettings { Formatting = Formatting.Indented }));
		}

